function PageRequest () {
    this._explicitType = "PageRequest";
    this.page = {
    	'_explicitType': "Page",
    	'content': new Array(),
    	'page': 1,
		'totalPages': 0,
		'total': 0,
		'range': 10
    };
    this.sort = {
    	'_explicitType': "Sort",
    	'direction': "asc",
    	'property': "id"
    };
}